import React from 'react';
import './navbar.css';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap'; // Import required components from react-bootstrap
import day_logo from '../../assets/day.png';
import light_person from '../../assets/person_light.png';

const CustomNavbar = () => {
  return (
    <Navbar bg="light" expand="lg" className="mb-4">
      <Container>
        <Navbar.Brand href="#home">MyApp</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>

            <NavDropdown title="Menu" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/1">Action 1</NavDropdown.Item>
              <NavDropdown.Item href="#action/2">Action 2</NavDropdown.Item>
              <NavDropdown.Item href="#action/3">Action 3</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/4">Separated Link</NavDropdown.Item>
            </NavDropdown>
          </Nav>

          {/* Image that triggers dropdown */}
          <NavDropdown
            title={<img src={light_person} alt="profile" className="profile-icon" />}
            id="profile-nav-dropdown"
            align="end" // Align dropdown to the right
          >
            <NavDropdown.Item href="#profile">Profile</NavDropdown.Item>
            <NavDropdown.Item href="#settings">Settings</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#logout">Logout</NavDropdown.Item>
          </NavDropdown>

          <img src={day_logo} alt="logo" className="navbar-logo" />
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default CustomNavbar;
